import React, {useEffect, useState} from 'react'
import axios from "axios";

export function GetVehicles() {
  const [veiculos, setVeiculos] = useState([]);
    return(
  useEffect(() => {
    axios
      .get("http://localhost:4000/veiculos")
      .then((res) => {
        setVeiculos(res.data);
      })
      .catch((error) => {
        console.error(error);
      });
  }, [])
  )
}
